import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Home = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <div className="home">
      <h1>Bienvenidos a Piscina Paraíso</h1>
      <p>¡Disfruta de un día increíble con nuestras modernas instalaciones!</p>
      <div className="carousel-container">
        <Slider {...settings}>
          <div>
            <img
              src="https://img.freepik.com/foto-gratis/azul-rippled-agua-fondo-piscina_1373-193.jpg?t=st=1736968630~exp=1736972230~hmac=dd332d35a7c381f2db33d4a1d3e19131cbcd149dfaf4a436548b0a04aa5e01ff&w=740"
              alt="Piscina 1"
              style={{ width: "100%", height: "100%", objectFit: "cover" }}
            />
          </div>
          <div>
            <img
              src="https://img.freepik.com/fotos-premium/piscina-cielo-azul-sol-brillando-sobre-ella_14865-984.jpg?w=996"
              alt="Piscina 2"
              style={{ width: "100%" }}
            />
          </div>
          <div>
            <img
              src="https://img.freepik.com/foto-gratis/disposicion-miniatura-hamacas-junto-piscina_23-2148633495.jpg?t=st=1736968698~exp=1736972298~hmac=0b0d0ded629c4e4e488bc6ff92d31faa93f35740e3328b2d9558e89e0550c426&w=740"
              alt="Piscina 3"
              style={{ width: "100%" }}
            />
          </div>
        </Slider>
      </div>
    </div>
  );
};

export default Home;
